import React from "react";
import logo from "../assets/logo.jpg";

function Navbar() {
  return (
    <div className="Navbar">
      <div className="leftside">
        <img src={logo} />
      </div>
      <div className="rightside">Left</div>
    </div>
  );
}

export default Navbar;
